graphviz:
digraph {
  // Graph attributes
  label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="center"><font point-size="12"><b>Resource Limits</b></font></td></tr><tr><td align="center"><font point-size="10">v @concurrent(&quot;4&quot;)</font></td></tr><tr><td><table border="0" cellborder="1" cellspacing="0" cellpadding="2" align="left"><tr><td port="logLevel__key" align="left" balign="left">logLevel</td><td port="logLevel__value" align="left" balign="left">info</td></tr><tr><td port="maxSteps__key" align="left" balign="left">maxSteps</td><td port="maxSteps__value" align="left" balign="left">1000</td></tr><tr><td port="maxConcurrentPaths__key" align="left" balign="left">maxConcurrentPaths</td><td port="maxConcurrentPaths__value" align="left" balign="left">4</td></tr></table></td></tr></table>>;
  labelloc="t";
  fontsize=10;
  fontname="Arial";
  compound=true;
  rankdir=TB;
  pad=0.25;
  node [fontname="Arial", fontsize=10];
  edge [fontname="Arial", fontsize=9];

  // Node definitions with nested namespaces
  "Worker1" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>Worker1</b> <i>&lt;init&gt;</i></td></tr><tr><td align="left">Worker 1</td></tr></table>>, shape=ellipse, fillcolor="#FFF3E0", style=filled, color="#F57C00"];
  "Worker2" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>Worker2</b> <i>&lt;init&gt;</i></td></tr><tr><td align="left">Worker 2</td></tr></table>>, shape=ellipse, fillcolor="#FFF3E0", style=filled, color="#F57C00"];
  "Worker3" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>Worker3</b> <i>&lt;init&gt;</i></td></tr><tr><td align="left">Worker 3</td></tr></table>>, shape=ellipse, fillcolor="#FFF3E0", style=filled, color="#F57C00"];
  "Worker4" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>Worker4</b> <i>&lt;init&gt;</i></td></tr><tr><td align="left">Worker 4</td></tr></table>>, shape=ellipse, fillcolor="#FFF3E0", style=filled, color="#F57C00"];
  "Process" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>Process</b> <i>&lt;state&gt;</i></td></tr><tr><td align="left">Process item</td></tr></table>>, shape=diamond, fillcolor="#F3E5F5", style=filled, color="#7B1FA2"];
  "Complete" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>Complete</b> <i>&lt;state&gt;</i></td></tr></table>>, shape=diamond, fillcolor="#F3E5F5", style=filled, color="#7B1FA2"];

  // Edges
  "Worker1" -> "Process" [labelOverlay="75%", labelhref="#srcLineTBD"];
  "Process" -> "Complete" [labelOverlay="75%", labelhref="#srcLineTBD"];
  "Worker2" -> "Process" [labelOverlay="75%", labelhref="#srcLineTBD"];
  "Process" -> "Complete" [labelOverlay="75%", labelhref="#srcLineTBD"];
  "Worker3" -> "Process" [labelOverlay="75%", labelhref="#srcLineTBD"];
  "Process" -> "Complete" [labelOverlay="75%", labelhref="#srcLineTBD"];
  "Worker4" -> "Process" [labelOverlay="75%", labelhref="#srcLineTBD"];
  "Process" -> "Complete" [labelOverlay="75%", labelhref="#srcLineTBD"];
}
